import java.util.ArrayList;
import java.util.List;

class Solution {
    public List<Integer> goodSubsetofBinaryMatrix(int[][] grid) {
        List<Integer> result = new ArrayList<>();
        int m = grid.length, n = grid[0].length;

        // Check each row individually to see if it can form a good subset by itself.
        for (int i = 0; i < m; i++) {
            boolean good = true;
            for (int j = 0; j < n; j++) {
                if (grid[i][j] > 0) { // Since k=1, no column sum should be greater than 0.
                    good = false;
                    break;
                }
            }
            if (good) {
                result.add(i); // Add current row as it forms a good subset by itself.
                return result; // Return immediately as only one such subset is needed.
            }
        }

        // If no single row forms a good subset, check for combinations of rows.
        for (int size = 2; size <= m; size++) { // Start from size 2 as single rows are already checked.
            if (findSubset(grid, 0, new ArrayList<>(), size, result)) {
                return result; // If a good subset is found, return it.
            }
        }

        return new ArrayList<>(); // Return empty list if no good subset is found.
    }

    private boolean findSubset(int[][] grid, int start, List<Integer> current, int size, List<Integer> result) {
        if (current.size() == size) {
            if (isGoodSubset(grid, current)) {
                result.addAll(current);
                return true;
            }
            return false;
        }

        for (int i = start; i <= grid.length - size + current.size(); i++) {
            current.add(i);
            if (findSubset(grid, i + 1, current, size, result)) {
                return true;
            }
            current.remove(current.size() - 1);
        }

        return false;
    }

    private boolean isGoodSubset(int[][] grid, List<Integer> subset) {
        int m = subset.size(), n = grid[0].length;
        for (int j = 0; j < n; j++) {
            int sum = 0;
            for (int row : subset) {
                sum += grid[row][j];
            }
            if (sum > m / 2) {
                return false; // If any column sum exceeds half the size of the subset, it's not good.
            }
        }
        return true;
    }
}
